import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div>
        <ul>
        <li class='home' data-text="Home">
            <a href='#'>Home</a>
        </li>
        <li class='about' data-text='About'>
            <a href='#'>About</a>
        </li>
        <li class='Portfolio' data-text='Portfolio'>
            <a href='#'>Portfolio</a>
        </li>
        <li class='contact' data-text='Contact'>
            <a href='#'>Contact</a>
        </li>
        </ul>
        </div>  
    );
  }

export default Home;
